import './Homepage.css';
import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';

function Homepage() {

    const [datas, setDatas] = useState(null);
    
    useEffect(() => {
        fetch("http://localhost:8000")
        .then((res) => {
            return res.json();
        })
        .then((data) => {
            console.log(data);
            setDatas(data);
        });
    }, []);

    let someId = Math.floor(Math.random() * 11);
    return(
        <main className="mainSection">
            <article className="mainArticle">
                <Link to={`/recipes/${someId}`}>
                   <h1>Kolaci neki</h1>
                </Link>
                <div className="mainWallpaper">Slika</div>
                <p>Autor: Dusan</p>
                <div> { datas.recipes }</div>
            </article>
      </main>
    );
};

export default Homepage;
